import React from 'react'
import Pi from "../NosPis/NosPis"


function NosPis({ eux }) {
  var i = 0
  const array = eux.map((item) => {
    if (i % 2 == 0) {
      {
        <div class="bg-white col-12 pt-2" >
          <Pi prenom={eux.prenom} nom={eux.nom} totem={eux.totem} timing={eux.totem}></Pi>
        </div>
      }
    } else {
      {
        <div class="bg-light col-12 pt-2" >
          <Pi prenom={eux.prenom} nom={eux.nom} totem={eux.totem} timing={eux.totem}></Pi>
        </div>
      }
    }
  }


  )
  return (
    <div class="row" name="ListePi">
      {array}
    </div>
  )
}

export default NosPis;
